import React, { useState } from 'react';
import { Document, Page, pdfjs } from 'react-pdf';
import 'react-pdf/dist/esm/Page/AnnotationLayer.css';

pdfjs.GlobalWorkerOptions.workerSrc = `//cdnjs.cloudflare.com/ajax/libs/pdf.js/${pdfjs.version}/pdf.worker.js`;
const PrintDocument = () => {
    const documentUrl="https://venor-printing.s3.eu-north-1.amazonaws.com/1_1234.pdf";
    const [numPages, setNumPages] = useState(null);

  const onDocumentLoadSuccess = ({ numPages }) => {
    setNumPages(numPages);
  };

  const handlePrint = () => {
    window.print();
  };

  return (
    <div>
        Printing with button 
        <div>
      <Document file={documentUrl} onLoadSuccess={onDocumentLoadSuccess}>
        {Array.from(new Array(numPages), (el, index) => (
          <Page key={`page_${index + 1}`} pageNumber={index + 1} />
        ))}
      </Document>
      <button onClick={handlePrint}>Print Document</button>
    </div>
    </div>
  );
};

export default PrintDocument;
